import styled from "styled-components";

export const Item = styled.div`
  background-color: var(--second-color);
  display: flex;
  align-items: center;
  justify-content: space-evenly;
  width: 70%;
  margin: 15px auto;
  padding: 10px;
  border-radius: 25px;
  & a {
    text-decoration: none;
    color: var(--white-color);
  }
`;
